import React from "react";

function Login() {
  return (
    <div className="login-form">
        <h1>Login</h1>
        <form>
            <input type="text" placeholder="Username" />
            <input type="password" placeholder="Password" />
            <button>Login</button>
        </form>
    </div>
  );
}

export default Login;
